sys_variable_value.value:
(function execute(inputs, outputs) {
    //To create a JSON object
    var input_json = inputs.json_string;
    var delimeter_value = inputs.delimiter.toString().trim();
    var currencyArray = new sn_sap_data_int.IntegrationsUtils().parseExecuteRFC(input_json, delimeter_value);
    outputs.currency = currencyArray.JSONOBJECT;
    outputs.total_rows = currencyArray.ROWCOUNT;
})(inputs, outputs);

